import React from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";
import "../styles/HomePage.css";

const HomePage = () => {
  const navigate = useNavigate();

  const handleNavigate = () => {
    navigate("/selection");
  };

  return (
    <div className="homepage">
      <Navbar />
      <div className="hero-section">
        <div className="hero-content">
          <h1>Streamline Your Returns with AI</h1>
          <p className="hero-description">
            Auditly revolutionizes product returns with our AI-driven solution. 
            Experience unparalleled efficiency and transparency in your return process.
          </p>
          <button className="cta-button" onClick={handleNavigate}>
            Start Your Return <span className="arrow">â†’</span>
          </button>
        </div>
        <div className="hero-image">
          {/* Add an illustrative image here */}
          <img src="/path-to-your-image.svg" alt="AI-powered returns process" />
        </div>
      </div>
      <div className="features-section">
        <h2>Why Choose Auditly?</h2>
        <div className="feature-grid">
          <div className="feature-item">
            <i className="feature-icon ai-icon"></i>
            <h3>AI-Powered</h3>
            <p>Intelligent processing for faster returns</p>
          </div>
          <div className="feature-item">
            <i className="feature-icon efficiency-icon"></i>
            <h3>Efficient</h3>
            <p>Streamlined workflow saves time and resources</p>
          </div>
          <div className="feature-item">
            <i className="feature-icon transparency-icon"></i>
            <h3>Transparent</h3>
            <p>Clear visibility into every step of the process</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
